import React from "react";
import notes from "../notes";

console.log(notes);



function Note() {
  return ( notes.map(notes => (
    <div className="note">
    <h1>{notes.title}</h1>
    <p>{notes.content}</p>
  </div>
  ))
  );
}

export default Note;
